import { createRouter, createWebHistory } from 'vue-router'
import Comp01View from '../views/Comp01View.vue'
import Comp02View from '../views/Comp02View.vue'
import Comp03View from '../views/Comp03View.vue'

const routes = [

  {
    path: '/',
    name: 'home',
    component: Comp01View
  },

  {
    path: '/Comp01View',
    name: 'Comp01View',
    component: Comp01View
  },

  {
    path: '/Comp02View',
    name: 'Comp02View',
    component: Comp02View
  },

  {
    path: '/Comp03View',
    name: 'Comp03View',
    component: Comp03View
  },
  /*
  {
    path: '/',
    name: 'Comp01View',
    component: () => import('../views/Comp01View.vue')
  },

  {
    path: '/Comp01View',
    name: 'Comp01View',
    component: () => import('../views/Comp01View.vue')
  },

  {
    path: '/Comp02View',
    name: 'Comp02View',
    component: () => import('../views/Comp02View.vue')
  },

  {
    path: '/Comp03View',
    name: 'Comp03View',
    component: () => import('../views/Comp03View.vue')
  },*/

];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
